import React, { useContext } from "react";
import { Card, Col, Image } from "react-bootstrap";

const ProductItem = ({ product }) => {
  return (
    <Col md={4}>
      <Card style={{ width: 330 }} border="secondary" className="mt-3">
        <Image width={320} height={300} src={product.image} className="mx-1 my-1 " />
      </Card>
    </Col>
  );
};

export default ProductItem;
